response.about:
очень темпераментная, а еще:

-люблю алый лак для ногтей, кружевные чулки, красное сухое вино и хороший кофе;

-люблю гулять в парке и встречать рассветы;

-я долго сопротивлялась, но мужчины сделали все, чтобы я им не верила;

-верю в то, что книги способны изменить людей;

-со мной сложно общаться и это факт;

-люблю снежинки на ресничках и утренний секс.

И хотя я до сих пор люблю тебя, мне комфортно от того, что ТЫ молчишь...
